void Rogue_fwrite( const char* utf8, RogueInt byte_count, RogueInt out )
{
  #if !defined(ROGUE_PLATFORM_EMBEDDED)
  while (byte_count)
  {
    RogueInt n = (RogueInt) write( out, utf8, byte_count );
    if (n > 0)
    {
      utf8 += n;
      byte_count -= n;
    }
  }
  #endif
}

